import React, { useState } from "react";

import Blogwebsite from "./assets/images/blog-website.png";
import Dicegame from "./assets/images/dice-game.png";
import Drumkit from "./assets/images/drum-kit.png";
import Emojipedia from "./assets/images/emojipedia.png";
import Keeperapp from "./assets/images/keeper-app.png";
import Newslettersignup from "./assets/images/newsletter-signup.png";
import Personalsite from "./assets/images/personal-site.png";
import Secretswebsite from "./assets/images/secrets-website.png";
import Simonsgame from "./assets/images/simons-game.png";
import Spacetourism from "./assets/images/space-tourism.png";
import Spreadoperator from "./assets/images/spread-operator.png";
import Timeapp from "./assets/images/time-app.png";
import Tindog from "./assets/images/tindog.png";
import Todolistv1 from "./assets/images/to-do-list-v1.png";
import Todolistv2 from "./assets/images/to-do-list-v2.png";

function Home(){

  const [navIconClicked, setNavIconClicked] = useState("navbar-toggler-icon");
  const [isClicked, setIsClicked] = useState(false);

  const [normalH3, clickH3] = useState("Projects");
  const [projectListclassName, setProjectListclassName] = useState("carousel slide carousel-fade");

  const [fadeOutMenu, setFadeOutMenu] = useState({
    "-webkit-animation-name": "",
    "animation-name": "",
    "animation-duration": ""
  });
  const [isMenuClicked, setIsMenuClicked] = useState(false);

  const [fadeOutEffect, setfadeOutEffect] = useState({
    "-webkit-animation-name": "",
    "animation-name": "",
    "animation-duration": ""
  });

  const [normalH1, clickH1] = useState("Hi, I'm Jeffin Jaison");
  const [normalH2, clickH2] = useState("A Full-Stack Web Developer");

  const [faviconClassName, setfaviconClassName] = useState("logo")

  function handleClick(){
    if (!isClicked) {
      setNavIconClicked("navbarClicked");
      clickH1("");
      clickH2("");
      clickH3("");
      setProjectListclassName("hidden");
      setIsClicked(true);
      setfaviconClassName("hidden");
    }else{
      setNavIconClicked("navbarClicked2");
      clickH1("Hi, I'm Jeffin Jaison");
      clickH2("A Full-Stack Web Developer"); 
      clickH3("Projects");
      setProjectListclassName("carousel slide carousel-fade");   
      setIsClicked(false);
      setfaviconClassName("logo");
    }

    if (!isMenuClicked) {
      setFadeOutMenu({
        "-webkit-animation-name": "fadeInRight",
        "animation-name": "fadeInRight",
        "animation-duration": "1s"
      })
      setfadeOutEffect({
        "-webkit-animation-name": "fadeOutRight",
        "animation-name": "fadeOutRight",
        "animation-duration": "0.5s"
      })
      setIsMenuClicked(true);
    }
    else{
      setFadeOutMenu({
        "-webkit-animation-name": "fadeOutRight",
        "animation-name": "fadeOutRight",
        "animation-duration": "0.5s"
      })
      setfadeOutEffect({
        "-webkit-animation-name": "fadeInRight",
        "animation-name": "fadeInRight",
        "animation-duration": "1s"
      })
      setIsMenuClicked(false);
    }
  };

    return (

      <>

  <section className="showcase">

  <video src="https://www.pexels.com/video/4507628/download/?h=1080&w=1920" playsInline autoPlay muted loop type="video/mp4"></video>
  <div className="overlay"></div>

      <h1 style={fadeOutEffect}>{normalH1}</h1>
      <h2 className="h2-title" style={fadeOutEffect}>{normalH2}</h2>

      <header>

      <a href="/">
      <img className={faviconClassName} src="assets/logo/favicon.ico" />
      </a>

        <div className="pos-f-t" id="my-navbar-collapse">
            <div className="collapse navbar-collapse" id="navbarToggleExternalContent">
              <div className="menu" style={fadeOutMenu}>
                <ul className="nav navbar-nav">
                <li>
              <a className="nav-link nav-links" href="/">Home</a>
            </li>
                  <li>
                    <a className="nav-link nav-links" href="/about">About</a>
                  </li>
                  <li>
                    <a className="nav-link nav-links" href="/skills">Skills & Tools</a>
                  </li>
                  <li>
                    <a className="nav-link nav-links" href="/projects">Projects</a>
                  </li>
                  <li>
                    <a className="nav-link nav-links" href="/contact">Contact</a>
                  </li>
                  <li>
                    <a className="nav-link nav-links" href="Jeffin_Jaison_Resume.pdf">
                    <svg className="download-button" xmlns="http://www.w3.org/2000/svg" width="25" height="25" viewBox="0 0 24 24"><path d="M19 9h-4V3H9v6H5l7 7 7-7zM5 18v2h14v-2H5z"/></svg>
                    Resume</a>
                  </li>
                </ul>
              </div>
            </div>
            <nav className="navbar navbar-dark">
              <button className="navbar-toggler" 
              type="button" 
              data-toggle="collapse" 
              data-target="#navbarToggleExternalContent"
              aria-controls="navbarToggleExternalContent"
              aria-expanded="false"
              aria-label="Toggle navigation"
              onClick={handleClick}>
                <span className={navIconClicked}></span>
              </button>
            </nav>
          </div>
        </header>

        </section>

        <section id="projects" className="skills-section color-443829">

      <div className="overlay2"></div>
            
            <h3 style={fadeOutEffect}>{normalH3}</h3>

<div style={fadeOutEffect} id="myCarousel" className={projectListclassName} data-ride="carousel" data-interval="10000" data-pause="hover">
        
        <ol className="carousel-indicators">
          <li data-target="#myCarousel" data-slide-to="0" className="active"></li>
          <li data-target="#myCarousel" data-slide-to="1"></li>
          <li data-target="#myCarousel" data-slide-to="2"></li>
          <li data-target="#myCarousel" data-slide-to="3"></li>
          <li data-target="#myCarousel" data-slide-to="4"></li>
          <li data-target="#myCarousel" data-slide-to="5"></li>
          <li data-target="#myCarousel" data-slide-to="6"></li>
          <li data-target="#myCarousel" data-slide-to="7"></li>
          <li data-target="#myCarousel" data-slide-to="8"></li>
          <li data-target="#myCarousel" data-slide-to="9"></li>
          <li data-target="#myCarousel" data-slide-to="10"></li>
          <li data-target="#myCarousel" data-slide-to="11"></li>
          <li data-target="#myCarousel" data-slide-to="12"></li>
          <li data-target="#myCarousel" data-slide-to="13"></li>
          <li data-target="#myCarousel" data-slide-to="14"></li>
        </ol>
        
        <div className="carousel-inner">

          <div className="carousel-item active">
          <img className="slide-item first-slide" src={Spacetourism} alt="First slide" />
          </div>
          <div className="carousel-item">
          <img className="slide-item second-slide" src={Drumkit} alt="Second slide" />
          </div>
          <div className="carousel-item">
          <img className="slide-item third-slide" src={Simonsgame} alt="Third slide" />
          </div>
          <div className="carousel-item">
          <img className="slide-item fourth-slide" src={Tindog} alt="Fourth slide" />
          </div>
          <div className="carousel-item">
          <img className="slide-item fifth-slide" src={Newslettersignup} alt="Fifth slide" />
          </div>
          <div className="carousel-item">
          <img className="slide-item sixth-slide" src={Dicegame} alt="Sixth slide" />
          </div>
          <div className="carousel-item">
          <img className="slide-item seventh-slide" src={Personalsite} alt="Seventh slide" />
          </div>
          <div className="carousel-item">
          <img className="slide-item eighth-slide" src={Blogwebsite} alt="Eighth slide" />
          </div>
          <div className="carousel-item">
          <img className="slide-item ninth-slide" src={Emojipedia} alt="Ninth slide" />
          </div>
          <div className="carousel-item">
          <img className="slide-item tenth-slide" src={Keeperapp} alt="Tenth slide" />
          </div>
          <div className="carousel-item">
          <img className="slide-item eleventh-slide" src={Timeapp} alt="Eleventh slide" />
          </div>
          <div className="carousel-item">
          <img className="slide-item twelveth-slide" src={Todolistv1} alt="Twelveth slide" /> 
          </div>
          <div className="carousel-item">
          <img className="slide-item thirteenth-slide" src={Todolistv2} alt="Thirteenth slide" />
          </div>
          <div className="carousel-item">
          <img className="slide-item fourteenth-slide" src={Spreadoperator} alt="Fourteeth slide" />
          </div>
          <div className="carousel-item">
          <img className="slide-item fifteenth-slide" src={Secretswebsite} alt="Fifteenth slide" />
          </div>

        </div>
        <a className="carousel-control-prev" href="#myCarousel" role="button" data-slide="prev">
          <span className="carousel-control-prev-icon" aria-hidden="true"></span>
          <span className="sr-only">Previous</span>
        </a>
        <a className="carousel-control-next" href="#myCarousel" role="button" data-slide="next">
          <span className="carousel-control-next-icon" aria-hidden="true"></span>
          <span className="sr-only">Next</span>
        </a>
      </div>

      </section>

</>

)};

export default Home;
